import Strategie from "./Strategie";
import Header from "./Header";
import Vulnerability from "./Vulnerability";
import Fasi from "./Fasi";
import Articoli from "./Articoli";
import MCV from "./MCV";
import UserCard from "./User_Card";

function Sidebar() {
  return (
    <div className="fixed top-0 left-0 m-4 flex flex-col items-center">
      <Header />

      {/* Create a separate container for buttons */}
      <div className="button-container space-y-4 flex flex-col items-center mt-4">
        <Strategie />
        <Vulnerability />
        <Fasi />
        <Articoli />
        <MCV />
      </div>

      <UserCard />
    </div>
  );
}

export default Sidebar;
